		this._notify.showSnackbar(snackbarConfig);
		this.errorEvent.next(err);
		this.logger.error(err.message, err);
		super.handleError(err);
	}

	/**
	 * Will notify the user and update the errorEvent Subject
	 * @param {number} errorCode
	 * @param {string} message
	 * @param {Error} err
	 */
	handleRequestError(errorCode: number, message: string, err: Error) {
		this.notifyUserSnackbar(errorCode, err.message);
		this.errorEvent.next(err);
		return throwError(err);
	}

	/**
	 * Handle a response error: notify the user and update the errorEvent Subject
	 * @param err
	 * @returns {Observable<Error>}
	 */
	handleResponseError(err: HttpErrorResponse) {
		this.notifyUserSnackbar(err.status, err.message);
		this.errorEvent.next(err.error);
		return throwError(err);
	}
}

import {Injectable} from '@angular/core';
import {LoggerService} from '@core/services/logger/logger.service';
import {BehaviorSubject} from 'rxjs';
import {tap} from 'rxjs/operators';
import {ApiEndpoints, ApiMethod} from '@core/interfaces/api.interface';
import {LocalStorageTypes} from '@core/interfaces/local-storage.interface';
import {ChangeUserPassword, RawUser, User} from '@core/models/user.model';
import {AppErrorHandler} from '@core/services/error-handler/error-handler.service';
import {HttpService} from '@core/services/http/http.service';
import {LocalStorageService} from '@core/services/local-storage/local-storage.service';

@Injectable({
	providedIn: 'root'
})
export class AuthService {
	authData: BehaviorSubject<RawUser> = new BehaviorSubject<RawUser>(null);

	constructor(
		private _http: HttpService,
		private _error: AppErrorHandler,
		private logger: LoggerService
	) {
	}

	/**
	 * Determine if current user is authenticated or not
	 * @returns {boolean}
	 */
	isAuthenticated() {
		return !!LocalStorageService.getItem(LocalStorageTypes.SESSION, 'user');
	}

	/**
	 * Get the current user
	 * @returns {User}
	 */
	getUser() {
		return User.deserialize(LocalStorageService.getItem(LocalStorageTypes.SESSION, 'user'));
	}

	/**
	 * Get the current user's initials
	 * @returns {string}
	 */
	getUserInitials() {
		if (this.getUser()) {
			return this.getUser().initials;
		}
		return null;
	}

	/**
	 * Perform the login and store the returned user in sessionStorage
	 * @param loginData {RawUser}
	 * @returns {Observable<User>}
	 */
	login(loginData: RawUser) {
		return this._http.requestCall(ApiEndpoints.LOGIN, ApiMethod.POST, loginData)
			.pipe(tap((rawUser: User) => {
				this.logger.info('User Logged in', rawUser);
				this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Perform a logout and remove the current user from sessionStorage
	 * @returns {Observable<User>}
	 */
	logout() {
		return this._http.requestCall(ApiEndpoints.LOGOUT, ApiMethod.GET)
			.pipe(tap((response) => {
				this.logger.info('User logged out', this.getUser());
				LocalStorageService.removeItem(LocalStorageTypes.SESSION, 'user');
				this.authData.next(null);
				return response;
			}));
	}

	/**
	 * Perform a registration and store the returned user in sessionStorage
	 * @param {RawUser} registrationData
	 * @returns {Observable<User>}
	 */
	register(registrationData) {
		return this._http.requestCall(ApiEndpoints.REGISTER, ApiMethod.POST, registrationData)
			.pipe(tap((rawUser: User) => {
				this.logger.info('User registered', rawUser);
				return this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Change a user's password
	 * @param {RawUser} chgPwData
	 * @returns {Observable<User>}
	 */
	changePassword(chgPwData: ChangeUserPassword) {
		return this._http.requestCall(ApiEndpoints.CHANGE_PW, ApiMethod.PUT, chgPwData)
			.pipe(tap((rawUser: User) => {
				this.logger.info('User changed password', rawUser);
				return this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Provide user a means to reset their password
	 * @param forgotPwData
	 * @return {Observable<User>}
	 */
	forgotPassword(forgotPwData) {
		return this._http.requestCall(ApiEndpoints.FORGOT, ApiMethod.PUT, forgotPwData)
			.pipe(tap((rawUser: User) => {
				this.logger.info('User forgot password', rawUser);
				this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * update a user's object in session storage
	 * @param user
	 * @returns {User}
	 */
	updateLocalUser(user: User) {
		LocalStorageService.setItem(LocalStorageTypes.SESSION, 'user', user);
		this.authData.next(user);
		return user;
	}
}

import {Injectable} from '@angular/core';
import {NavigationEnd, NavigationStart, Router} from '@angular/router';
import {BehaviorSubject} from 'rxjs';
import {titleCaseString} from '@shared/utils/string.utils';
import {Breadcrumb} from '@layout/interfaces/breadcrumb.interface';

/**
 * Provides management of breadcrumbs base on the route
 */
@Injectable({
	providedIn: 'root'
})
export class BreadcrumbService {
	breadcrumbs: Breadcrumb[] = [];
	breadcrumbsSub: BehaviorSubject<any[]> = new BehaviorSubject<Breadcrumb[]>([]);

	/**
	 * BreadcrumbService constructor. Subscribes to router events and updates breadcrumbs
	 * accordingly
	 * @param _router
	 * @constructor
	 */
	constructor(
		private _router: Router
	) {
		_router.events.subscribe((evt) => {
			if (evt instanceof NavigationStart) {
				if (evt.navigationTrigger === 'popstate') {
					this.goBackOne();
				}
			} else if (evt instanceof NavigationEnd) {
				const title = this._getBcTitle(evt.urlAfterRedirects);
				if (title && title !== 'Unknown') {
					this.addBreadcrumb({
						url: evt.urlAfterRedirects,
						title
					});
				}
			}
		});
	}

	/**
	 * Add a breadcrumb to the breadcrumbs array
	 * @param breadCrumb {Breadcrumb}
	 */
	addBreadcrumb(breadCrumb: Breadcrumb) {
		const breadcrumbExists = this.breadcrumbs.find(bc => bc.url === breadCrumb.url);
		if (!breadcrumbExists) {
			this.breadcrumbs.push(breadCrumb);
			this.breadcrumbsSub.next(this.breadcrumbs);
		}
	}

	/**
	 * Go back one breadcrumb
	 */
	goBackOne() {
		this.breadcrumbs.pop();
		this.breadcrumbsSub.next(this.breadcrumbs);
	}

	/**
	 * Get the breadcrumb title from the route
	 * @param url {string}
	 * @returns {string}
	 * @private
	 */
	private _getBcTitle(url: string): string {
		const urlArr = url.split('/');
		const unCasedTitle = urlArr[urlArr.length - 1] || 'Unknown';
		return titleCaseString(unCasedTitle);
	}

}

import {
	ApplicationRef,
	ComponentFactoryResolver,
	ComponentRef,
	EmbeddedViewRef,
	Injectable,
	Injector
} from '@angular/core';

/**
 * This service is for injecting components into the document body and being able to destroy them and ensuring that the component
 * is known to the ng component tree.
 *
 * Unfortunately this service cannot be injected via a parameter in a constructor. It must be used from the
 * Injector @link {Injector}
 *
 * @example
 *
 * constructor(private _injector: Injector){}
 *
 * someMethod() {
 *   const domInjector: DomInjectorService = this._injector.get(DomInjectorService);
 * }
 */
@Injectable()
export class DomInjectorService {

	constructor(
		private _componentFactoryResolver: ComponentFactoryResolver,
		private _appRef: ApplicationRef,
		private _injector: Injector
	) {}

	/**
	 * Create a ComponentRef<unknown> from passed in component
	 * @param {any} component a component class
	 * @param {any} componentProps an object which contains the @Input properties to set on component
	 * @returns {ComponentRef}
	 */
	createComponent(component: any, componentProps?: object) {
		// 1. Create a component reference from the component
		const componentRef = this._componentFactoryResolver
			.resolveComponentFactory(component)
			.create(this._injector);

		if (componentProps && typeof componentRef.instance === 'object') {
			Object.assign(componentRef.instance as object, componentProps);
		}

		return componentRef;
	}

	/**
	 * Add the passed componentRef to the ng component tree and append to the appendTo element
	 * @param {ComponentRef} componentRef
	 * @param {Element} appendTo
	 * @returns {HTMLElement}
	 */
	attachComponent(componentRef: ComponentRef<unknown>, appendTo: Element) {
		// 2. Attach component to the appRef so that it's inside the ng component tree
		this._appRef.attachView(componentRef.hostView);

		// 3. Get DOM element from component
		const domElem: HTMLElement = (componentRef.hostView as EmbeddedViewRef<any>)
			.rootNodes[0] as HTMLElement;

		// 4. Append DOM element to the the appendTo element
		appendTo.appendChild(domElem);
		return domElem;
	}

	/**
	 * Remove the componentRef from the ng component tree, destroy the component and remove it
	 * from the DOM
	 * @param {ComponentRef} componentRef
	 */
	removeComponent(componentRef: ComponentRef<unknown>) {
		if (componentRef) {
			const hostView = componentRef.hostView;
			const hostDomElem: HTMLElement = (hostView as EmbeddedViewRef<any>).rootNodes[0] as HTMLElement;
			this._appRef.detachView(componentRef.hostView);
			componentRef.destroy();
			hostDomElem.remove();
		}
	}
}

