				.pipe(
					map((rawUser) => new ForgotUserPasswordSuccessAction(rawUser)),
					catchError(err => of(new ForgotUserPasswordFailureAction(err)))
				)
			)
		);

	constructor(
		private actions: Actions,
		private _auth: AuthService
	) {}
}

